const Entries: React.FC<{}> = ({ user }) => {
  const [date, setDate] = useState('2017-05-24')
  const classes = useStyles();

  // useEffect(() => {
  //   get();
  // }, [get]);

  // if (isLoading) {
  //   return <div>Loading ...</div>;
  // }

  function handeleChange(e) {
    console.log(e.target.value)
    setDate(e.target.value)
  }

  return (
    <Box>
       <h4>Entries</h4>
       <Box>
                <Formik
                    initialValues={{
                        catagorie: "",
                        amount: ""
                    }}
                    onSubmit={async (values, actions) => {


                        console.log('REsult', values)

                    }}
                >   
                    {(props) => (
                    <Form>
                        <Box>
                        <TextField
                            id="date"
                            label="Birthday"
                            onChange={handeleChange}
                            value={date}
                            type="date"
                            className={classes.textField}
                            InputLabelProps={{
                            shrink: true,
                          }}
                        />

                        </Box>
                        <Box>
                            <FormField
                                {...props}
                                name="amount"
                                placeholder="Spent amount $"
                                label="amount"
                            />
                        </Box>
                        <Box>
                            <FormField
                                {...props}
                                name="catagorie"
                                placeholder="Catagory"
                                label="catagorie"
                            />
                        </Box>
                        <Button type="submit">
                              Create Entry
                        </Button>    
                    </Form>
                    )}
                </Formik>
            </Box>
    </Box>
  );
};
const mapStateToProps = (state) => {
  return {
    user: state.userReducer.data,
    isLoading: state.banksReducer.isLoading,
  };
};

const mapDispatchToState = {

};

// export default Entries;
export default connect(mapStateToProps, mapDispatchToState)(Entries);
